How do I format the output of a nested mongodb query result<p>I would like to format the output of my MongoDB query.</p>
<p>The following query</p>
<pre><code>db.getCollection(&quot;books&quot;).find({})
</code></pre>
<p>returns the following json:</p>
<pre><code>{
 title: &quot;book 1&quot;,
 numberOfReaders: 3,
 characters: [{
  name: &quot;annie&quot;,
  age: 3,
  height: 60,
  items: {
   itemName: &quot;watch&quot;,
   itemDesc: &quot;tells time&quot;
  },{
  name: &quot;bob&quot;,
  age: 5,
  height: 100,
  items: {
   itemName: &quot;sword&quot;,
   itemDesc: &quot;a long metallic sword&quot;
 }]
}
</code></pre>
<p>I realised that i can control the formatting for the JSON output using $ so the following query:</p>
<pre><code>db.getCollection(&quot;books&quot;).find({},{
 title: &quot;$title&quot;,
 numberOfReaders: &quot;$numberOfReaders&quot;,
}) 
</code></pre>
<p>which returns the following json:</p>
<pre><code>{
 title: &quot;book 1&quot;,
 numberOfReaders: 3, // excludes the characters array
}
</code></pre>
<p>But how do I control the output of the json for nest arrays such that the output is as follows:</p>
<pre><code>{
 title: &quot;book 1&quot;,
 numberOfReaders: 3,
 characters: [{ // removed age, height and itemDesc for all character objects
  name: &quot;annie&quot;, 
  items: {
   itemName: &quot;watch&quot;,
  },{
  name: &quot;bob&quot;,
  items: {
   itemName: &quot;sword&quot;,
 }]
}
</code></pre>
<p>Furthermore, how do I do this if the characters array was wrapped around another array</p>
<pre><code>{
 title: &quot;book 1&quot;,
 numberOfReaders: 3,
 characters: [[{ // removed age, height and itemDesc for all character objects, characters property are wrapped in two arrays
  name: &quot;annie&quot;, 
  items: {
   itemName: &quot;watch&quot;,
  },{
  name: &quot;bob&quot;,
  items: {
   itemName: &quot;sword&quot;,
  }]]
}
</code></pre>

