Unable to Map Array of MongoDB Documents Returned from Backend into React Components<p>I am trying to get my front-end to call to the back-end for all the &quot;blog posts&quot; that are stored in my MongoDB database. At the moment there is only one document for testing.</p>
<p>On the backend I have this api endpoint:</p>
<pre><code>app.get(&quot;/api/blogs&quot;, async (req, res) =&gt; {
    console.log(&quot;Getting blog items...&quot;);
    try{
        const blogs = await blogActions.getBlogItems();
        res.status(200).json({blogs});
    } catch (err) {
        console.log(err)
    }
});
</code></pre>
<p>This calls to a separate JS file with this function:</p>
<pre><code>const { MongoClient } = require('mongodb');
const uri = 'mongodb://localhost:27017';
const client = new MongoClient(uri);

const connection = async () =&gt; {
    try {
        const database = client.db('personalwebsite');
        const blogs = database.collection('blogs');

        return blogs;
    } catch (err) {
        console.log(err);
    }
}

const getBlogItems = async () =&gt; {
    const conn = await connection();
    try {
        return await conn.find({}).toArray();
    } catch (err) {
        console.log(err);
    }
};
</code></pre>
<p>Then in my React front-end I am trying to take the returned array and set it to an Array there in order to map over it and create a new BlogItem component for each blog returned from the database:</p>
<pre><code>import { useState, useEffect } from &quot;react&quot;;
import Navbar from &quot;../components/Navbar.tsx&quot;;
import BlogItem from &quot;../components/BlogItem.tsx&quot;;
import '../styles/Blog.css';

export default function Blog () {
    const [isLoggedIn, setIsLoggedIn] = useState&lt;boolean&gt;(false);
    const [isAdmin, setIsAdmin] = useState&lt;boolean&gt;(false);
    const [token, setToken] = useState&lt;string&gt;('');
    const [blogs, setBlogs] = useState([]);

    useEffect(() =&gt; {
        setToken(localStorage.getItem('token'));

        async function checkToken () {
            const response = await fetch('/api/token', {
              method: 'POST',
              headers: {
                  'Content-type': 'application/json',
                  'Authorization': `Bearer ${token}`
              }
            });
            if (response.ok){
              const jsonResponse = await response.json();
              if (jsonResponse.delete){
                localStorage.clear();
                return false;
              }
              return true;
            } else {
              console.log(&quot;Failed to fetch status of the User Login Session.&quot;);
            }
        }

        async function checkIfAdmin () {
            const response = await fetch('/api/users/permissions', {
                method: 'POST',
                headers: {
                    'Content-type': 'application/json',
                    'Authorization': `Bearer ${token}`
                }
            });
            if(response.ok) {
                const jsonResponse = await response.json();
                if (jsonResponse.role === 'admin') {
                    setIsAdmin(true);
                } else {
                    setIsAdmin(false);
                }
            }
        }

        async function getBlogItems () {
            try {
                const response = await fetch('/api/blogs');
                const data = await response.json();
                console.log(&quot;Before setBlogs&quot;, data.blogs)
                if(data.blogs.length &gt; 0) {
                    setBlogs(data.blogs);
                }
            } catch (err) {
                console.log(err);
            }
        }

        if (token) {
            checkToken().then(isValid =&gt; {
                if (!isValid) return;
                checkIfAdmin();
            });
        }

        getBlogItems();

    }, [])

    console.log(&quot;After setBlogs&quot;, blogs);

    return (
        &lt;div className=&quot;App&quot;&gt;
          &lt;Navbar /&gt;
          &lt;main className=&quot;main-content&quot;&gt;
            &lt;div className=&quot;blogs-container&quot;&gt;
                {blogs.length &gt; 0 ? (
                    blogs.map((blog) =&gt; (
                        &lt;BlogItem
                            key={blog._id}
                            title={blog.title}
                            shortDesc={blog.shortDesc}
                            imgSrc={blog.imgSrc}
                            pubDate={blog.pubDate}
                        /&gt;
                    ))
                ) : (
                    &lt;div&gt;Loading...&lt;/div&gt;
                )}  
            &lt;/div&gt;
            &lt;div className=&quot;most-popular&quot;&gt;&lt;/div&gt;
          &lt;/main&gt;
        &lt;/div&gt;
    );
}
</code></pre>
<p>I have tried quite a few different methods for trying to get this to work correctly. At first I thought it was just a problem with the data not being returned quickly enough but even after getting the code to wait for the data to be returned and getting the Array to set. I get an error that Objects are not valid as a React child.</p>
<p>This is meant to be an array of Objects so that I can access the properties of each object for the elements in the component but I cannot get it to work for the life of me. I spent awhile using ChatGPT to try and get some progress out of it but this seems to be a problem that requires human intervention instead.</p>

